import React from "react";
import { useAuth } from "./AuthContext";

const Dashboard = () => {
  const { currentUser } = useAuth(); // Destructure the currentUser and logout object from the context

  const getUserDetails = () => {
    return "haz el mejor tfg de tu vida";
  };

  return <>{currentUser ? getUserDetails() : "No user logged in"}</>;
};

function notLoggedIn() {
  return (
    <>
      <h1>Not logged in!</h1>
      <p>You need to log in to see this page.</p>
    </>
  );
}

export default Dashboard;
